pragma solidity ^0.8.0;
import "./ERC721Tradable.sol";


contract LeaveAMark is ERC721Tradable { 
  struct Mark {
    string name;
    string value;
  }

  mapping(uint256 => Mark) id_to_mark;

  mapping(string => uint256) mark_name_to_id;

  string private _currentBaseURI;

  constructor(address _proxyRegistryAddress) ERC721Tradable("LeaveAMark", "LAM", _proxyRegistryAddress) {
    setBaseURI("https://leave-a-mark-in-meta.herokuapp.com/api/token/");
  }

  function setBaseURI(string memory baseURI) public onlyOwner {
        _currentBaseURI = baseURI;
    }

  function baseTokenURI() virtual public view override returns (string memory) {
      return _currentBaseURI;
  }

  function mint(string memory name, string memory value) external onlyOwner returns(uint256) {
    require(bytes(name).length > 0, "The name must not be empty");
    require(bytes(value).length > 0, "The value must not be empty");
    require(bytes(name).length < 25, "The name must be shorter than 25 characters");
    require(mark_name_to_id[name] == 0, "The name has been taken");
    uint256 tokenId = id(name, value);

    id_to_mark[tokenId] = Mark(name, value);
    mark_name_to_id[name] = tokenId;
    _safeMint(msg.sender, tokenId);
    return tokenId;
  }

  function id(string memory name, string memory value) view internal returns(uint256) {
    // Psudo random id generator
    return uint256(keccak256(abi.encode(block.timestamp, block.difficulty, name, value)));
  }

  function get_mark(uint256 tokenId) external view returns (string memory name, string memory value) {
      require(_exists(tokenId), "token not minted");
      Mark memory theMark = id_to_mark[tokenId];
      name = theMark.name;
      value = theMark.value;
  }

  function get_id(string memory name) external view returns (uint256 id_of_mark) {
      id_of_mark = mark_name_to_id[name];
      require(id_of_mark != 0, "This name has not been claimed");
  }
}
